import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const DetailsPage = () => {
  const [details, setDetails] = useState({ age: '', gender: '' });
  const navigate = useNavigate();

  const onChange = (e) => setDetails({ ...details, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
    // In a real app, you would save these details to the backend
    console.log('User Details:', details);
    navigate('/quiz', { state: { personalDetails: details } });
  };

  return (
    <div>
      <h2>Personal Details</h2>
      <p>Please provide some basic information to continue.</p>
      <form onSubmit={onSubmit}>
        <input type="number" placeholder="Age" name="age" onChange={onChange} required />
        <select name="gender" onChange={onChange} required>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>
        <button type="submit">Proceed to Quiz</button>
      </form>
    </div>
  );
};

export default DetailsPage;
